import React from "react";
import DataTable from "../Components/DataTable";
import ToolBar from "../Components/ToolBar";
import Form from "../Components/Form";
import Divider from "@mui/material/Divider";
import axios from "axios";

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = { pageNumbers: 10, page: 1, data: {} };
  }
  pageNumberChanged = (e, page) => {
    console.log("pageNumberChanged :", page);
    this.setState({ page: page });
  };

  onSubmitClicked = (data) => {
    console.log("Data: ", data);
    const query = data.data.searchText;
    this.searchByZip(query, data);
  };

  searchByZip = (query, data) => {
    axios
      .get(`http://127.0.0.1:3000/api/v1/get_apt?search_by=zip&query=${query}`)
      .then((response) => {
        console.log("Response : ", response);
        this.setState({ data: response.data });
      });
  };

  searchByCity = (query, data) => {
    axios
      .get(`http://127.0.0.1:3000/api/v1/get_apt?search_by=zip&query=${query}`)
      .then((response) => {
        console.log("Response : ", response);
        this.setState({ data: response.data });
      });
  };

  searchByApartmentName = (query, data) => {
    axios
      .get(`http://127.0.0.1:3000/api/v1/get_apt?search_by=zip&query=${query}`)
      .then((response) => {
        console.log("Response : ", response);
        this.setState({ data: response.data });
      });
  };

  render() {
    return (
      <div
        style={{ display: "flex", flexDirection: "column", overflow: "auto" }}
      >
        <ToolBar />
        <div style={{ marginTop: 80, marginBottom: 20 }}>
          <Form onSubmitClicked={(data) => this.onSubmitClicked(data)} />
        </div>
        <Divider />
        <div style={{ marginTop: 20 }}>
          <DataTable />
        </div>
      </div>
    );
  }
}

export default Home;
